We begin by adding 2 to both sides of the equation, \begin{align*} 23&=x^4+\frac{1}{x^4}
\\\Rightarrow\qquad 25&=x^4+\frac{1}{x^4}+2
\\\Rightarrow\qquad 25&=x^4+2(x^2)\left(\frac{1}{x^2}\right)+\frac{1}{x^4}
\\\Rightarrow\qquad 25&=\left(x^2+\frac{1}{x^2}\right)^2
\end{align*}  So $x^2+\frac{1}{x^2}$ is equal to either $5$ or $-5$. Since $x^2+\frac{1}{x^2}$ is the sum of two squares, it cannot be negative.  So $x^2+\frac{1}{x^2}=\boxed{5}$.

To start, note that $\frac{x}{x^{2/3}}=x^{1-\frac{2}{3}}=x^{1/3}$.  Also note that we can rewrite the cube root with a fractional exponent, so $\sqrt[3]{x}=x^{1/3}$.  Using these pieces of information, rewrite the given equation as: $$4x^{1/3}-2x^{1/3}=7+x^{1/3}$$ Move all $x^{1/3}$ terms to one side and simplify: \begin{align*}
2x^{1/3}-x^{1/3}&=7\\
\Rightarrow\qquad x^{1/3}&=7\\
\Rightarrow\qquad (x^{1/3})^3&=7^3\\
\Rightarrow\qquad x&=\boxed{343}
\end{align*}

